import logo from "./pokeball.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="Pokemon-logo" alt="logo" />
        <PokemonView/>
      </header>
    </div>
  );
}

export default App;
